import {FETCH_POSTS, NEW_POST} from './types.js';

export const fetchPosts = () => dispatch => {
    fetch('https://jsonplaceholder.typicode.com/posts')
        .then(res => res.json())
        .then(posts => dispatch({
            type: FETCH_POSTS,
            payload: posts
        }));
};

export const createPost = (postData) => dispatch => {
    dispatch({
        type: NEW_POST,
        payload: postData
    })
};
